    subject: "Change commit branches calculation",
    body:
      'This remove temporal coupling between commit branches & branches paths.\nIt doesn\'t seem to have an impact on current rendering scenarios.\n\nOnly push "first parent" branch.\n\nFor example: commits of a branch won\'t be considered part of master.\nThat\'s because, for rendering, we consider commits of the branch being\nat a different position than commits on "master".\n\nBut commits created on master before branch was created will be part\nof both "master" and the branch.\n=> might not be necessary as it\'s not consistent, but it works so far.',
